display: flex;
flex-wrap: wrap;
justify-content: center;
width: 44%;
height: 250px;
margin: 3%;
padding-top: 5px;
/* background-color: #9b1d14; */
user-select: none;
text-decoration: none;
border-radius: 10px;
`;


type Props = {}

const Proccesing = (props: Props) => {
    return (
        <>
            <div className="card">
                <ProgressBar mode="indeterminate" style={{ height: '6px' }}></ProgressBar>
            </div>
        </>
    )
}

